#encoding=utf-8
import base64

def decode_base(b):
    a = b
    i = 0
    while True:
        i = i + 1
        print(i)
        #base16
        try:
            c = base64.b16decode(a)
            a = c
            print(a)
            print('using base16 decode success')
            continue
        except:
            print('using base16 decode failure')
            pass

        #base32
        try:
            c = base64.b32decode(a)
            a = c
            print(a)
            print('using base32 decode success')
            continue
        except:
            print('using base32 decode failure')
            pass


        #base64
        try:
            c = base64.b64decode(a)
            a = c
            print(a)
            print('using base64 decode success')
            continue
        except:
            print('using base64 decode failure')
            pass
        break
        print(a)

strs = ''

e = decode_base(strs)
print(e)